#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define MAXN 100005
#define MAXH 205

typedef struct {
    int A, B, C, D;
} Piece;

int N, H;
Piece pieces[MAXN];
int dp[1 << MAXH][MAXH];

int main() {
    scanf("%d %d", &N, &H);
    for (int i = 1; i <= N; i++) {
        scanf("%d %d %d %d", &pieces[i].A, &pieces[i].B, &pieces[i].C, &pieces[i].D);
    }

    for (int i = 0; i < (1 << H); i++) {
        for (int j = 0; j <= H; j++) {
            dp[i][j] = -1;
        }
    }

    dp[0][0] = 0;

    for (int i = 1; i <= N; i++) {
        for (int j = 0; j < (1 << H); j++) {
            for (int k = 0; k <= H; k++) {
                if (dp[j][k] == -1) continue;
                int nj = j | (1 << (pieces[i].A - 1));
                int nk = k + pieces[i].C;
                if (nk > H) continue;
                if (pieces[i].D > k) continue;
                dp[nj][nk] = 1;
            }
        }
    }

    int ans = 0;
    for (int i = 0; i < (1 << H); i++) {
        for (int j = 0; j <= H; j++) {
            if (dp[i][j] == 1) {
                ans = 1;
            }
        }
    }

    if (ans) {
        printf("YES\n");
    } else {
        printf("NO\n");
    }

    return 0;
}
